Rodzaj sił zbrojnych (RSZ) – główna część składowa sił zbrojnych zdolna do mniej lub bardziej samodzielnego wykonywania zadań strategicznych i operacyjnych w określonym środowisku: na lądzie, morzu, w przestrzeni powietrznej i kosmicznej, przy użyciu odpowiednich dla nich środków i sposobów walki. Każdy RSZ stanowi zwykle określoną całość organizacyjną wyposażoną we właściwy mu podstawowy sprzęt i uzbrojenie, mającą odpowiednie sposoby prowadzenia działań bojowych (operacji), swoiste formy szkolenia, a także zasady służby wojskowej, zasady materiałowego i technicznego zabezpieczenia oraz zasady organizacji wojsk. Zależnie od właściwości danego RSZ w jego skład wchodzą jednostki i związki odpowiednich rodzajów wojsk i służb. Najczęstszymi RSZ są: wojska lądowe, wojska lotnicze (siły powietrzne) i marynarka wojenna. Ponadto w niektórych armiach występują lub występowały odrębne RSZ np.: 
* Wojska Rakietowe Przeznaczenia Strategicznego ZSRR; 
* Wojska Rakietowe Przeznaczenia Strategicznego Federacji Rosyjskiej; 
* Wojska Obrony Powietrznej Kraju byłych Sił Zbrojnych PRL; 
* Korpus Piechoty Morskiej Stanów Zjednoczonych.
